import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Menu, X, Globe } from 'lucide-react';
import { useLanguage } from './Layout';
import { content } from '../lib/data';

const Navbar: React.FC = () => {
    const { language, setLanguage } = useLanguage();
    const [isScrolled, setIsScrolled] = useState(false);
    const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
    const t = content[language].nav;

    useEffect(() => {
        const handleScroll = () => {
            setIsScrolled(window.scrollY > 50);
        };
        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    const toggleLanguage = () => {
        setLanguage(language === 'ar' ? 'en' : 'ar');
    };

    const navLinks = [
        { name: t.home, href: '#hero' },
        { name: t.destinations, href: '#destinations' },
        { name: t.gallery, href: '#gallery' },
        { name: t.blog, href: '#tips' },
        { name: t.contact, href: '#footer' },
    ];

    return (
        <nav
            className={`fixed top-0 left-0 right-0 z-50 transition-all duration-300 ${isScrolled ? 'glass shadow-lg py-2' : 'bg-transparent py-4'
                }`}
        >
            <div className="container mx-auto px-4 flex justify-between items-center">
                {/* Logo */}
                <a href="#" className="text-2xl font-bold text-primary flex items-center gap-2">
                    <img src="/images/yemen_gems_logo_1764603069831.png" alt="Logo" className="h-10 w-10 object-contain" />
                    <span className={isScrolled ? 'text-neutral-dark' : 'text-white'}>
                        {language === 'ar' ? 'جواهر اليمن' : 'Yemen Gems'}
                    </span>
                </a>

                {/* Desktop Menu */}
                <div className="hidden md:flex items-center gap-8">
                    {navLinks.map((link) => (
                        <a
                            key={link.name}
                            href={link.href}
                            className={`text-sm font-medium transition-colors hover:text-primary ${isScrolled ? 'text-neutral-dark' : 'text-white/90'
                                }`}
                        >
                            {link.name}
                        </a>
                    ))}

                    <button
                        onClick={toggleLanguage}
                        className={`flex items-center gap-1 px-3 py-1 rounded-full border transition-all ${isScrolled
                                ? 'border-primary text-primary hover:bg-primary hover:text-white'
                                : 'border-white/50 text-white hover:bg-white/20'
                            }`}
                    >
                        <Globe size={16} />
                        <span className="text-xs font-bold">{language === 'ar' ? 'EN' : 'عربي'}</span>
                    </button>

                    <a
                        href="#footer"
                        className="bg-primary hover:bg-primary/90 text-white px-5 py-2 rounded-full text-sm font-bold transition-transform hover:scale-105 shadow-lg"
                    >
                        {t.book}
                    </a>
                </div>

                {/* Mobile Menu Button */}
                <button
                    onClick={() => setIsMobileMenuOpen(true)}
                    className={`md:hidden p-2 rounded-lg ${isScrolled ? 'text-neutral-dark' : 'text-white'
                        }`}
                >
                    <Menu size={28} />
                </button>
            </div>

            {/* Mobile Menu Overlay */}
            <AnimatePresence>
                {isMobileMenuOpen && (
                    <motion.div
                        initial={{ x: '100%' }}
                        animate={{ x: 0 }}
                        exit={{ x: '100%' }}
                        transition={{ type: 'tween', duration: 0.3 }}
                        className="fixed inset-0 z-50 bg-neutral-light md:hidden flex flex-col"
                    >
                        <div className="p-4 flex justify-between items-center border-b border-neutral-200">
                            <span className="text-xl font-bold text-primary">
                                {language === 'ar' ? 'القائمة' : 'Menu'}
                            </span>
                            <button
                                onClick={() => setIsMobileMenuOpen(false)}
                                className="p-2 text-neutral-dark hover:text-primary"
                            >
                                <X size={28} />
                            </button>
                        </div>

                        <div className="flex-1 flex flex-col p-6 gap-6 overflow-y-auto">
                            {navLinks.map((link) => (
                                <a
                                    key={link.name}
                                    href={link.href}
                                    onClick={() => setIsMobileMenuOpen(false)}
                                    className="text-xl font-medium text-neutral-dark hover:text-primary transition-colors"
                                >
                                    {link.name}
                                </a>
                            ))}

                            <hr className="border-neutral-200" />

                            <button
                                onClick={() => {
                                    toggleLanguage();
                                    setIsMobileMenuOpen(false);
                                }}
                                className="flex items-center gap-2 text-lg font-medium text-neutral-dark"
                            >
                                <Globe size={20} />
                                <span>{language === 'ar' ? 'English' : 'العربية'}</span>
                            </button>

                            <a
                                href="#footer"
                                onClick={() => setIsMobileMenuOpen(false)}
                                className="bg-primary text-white py-3 rounded-xl text-center font-bold text-lg shadow-md mt-auto"
                            >
                                {t.book}
                            </a>
                        </div>
                    </motion.div>
                )}
            </AnimatePresence>
        </nav>
    );
};

export default Navbar;
